import react from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import notes from "../notes"

function App(){
    return <div>
        <Header />
        {notes.map(obj=><Note 
            title={obj.title}
            content={obj.content}
        />)}
        <Footer />
    </div>;
}
 
export default App;
